import os
import time
from flask import Flask, request, jsonify

app = Flask(__name__)

# In-memory storage for submissions
submissions = {}
published_submissions = set()

class Submission:
    def __init__(self, file_data, user_type):
        self.file_data = file_data
        self.user_type = user_type
        self.is_valid = self.validate()
        self.last_modified = time.time()

    def validate(self):
        # Simple validation logic: must contain 'data' key with a non-empty value
        if isinstance(self.file_data, dict) and 'data' in self.file_data and self.file_data['data']:
            return True
        return False

    def publish(self):
        if self.is_valid:
            if self.file_data['id'] not in published_submissions:
                published_submissions.add(self.file_data['id'])
                self.last_modified = time.time()
                return True
            else:
                return False  # Prevent double publishing
        return False

@app.route('/upload', methods=['POST'])
def upload_file():
    if 'file' not in request.files:
        return jsonify({'error': 'No file part'}), 400
    file = request.files['file']
    if file.filename == '':
        return jsonify({'error': 'No selected file'}), 400

    file_data = {'data': file.read(), 'id': file.filename}
    user_type = request.form.get('user_type', 'user')
    submission = Submission(file_data, user_type)

    if not submission.is_valid:
        return jsonify({'error': 'Invalid submission data'}), 400

    submissions[file.filename] = submission
    return jsonify({'message': 'File uploaded successfully'}), 200

@app.route('/submit', methods=['POST'])
def submit_data():
    file_id = request.json.get('file_id')
    if file_id not in submissions:
        return jsonify({'error': 'Submission not found'}), 404

    submission = submissions[file_id]
    if submission.publish():
        return jsonify({'message': 'Submission published successfully'}), 200
    else:
        return jsonify({'error': 'Submission already published'}), 400

@app.route('/submissions', methods=['GET'])
def get_submissions():
    return jsonify({file_id: {'is_valid': sub.is_valid, 'last_modified': sub.last_modified} 
                    for file_id, sub in submissions.items()}), 200

@app.route('/styles', methods=['POST'])
def apply_styles():
    styles = request.json.get('styles')
    # In a real application, you might store these styles and apply them in the UI
    return jsonify({'message': 'Styles applied successfully', 'styles': styles}), 200

if __name__ == '__main__':
    app.run(debug=True)
